import React from 'react'
import * as C from './styles';

const Help = ({ toggleHelp }) => {

    
    
    return (
        <C.HelpContainer onLoad={() => toggleHelp()}>
            {/* <C.HelpBox> */}
            <C.VideoContainer>
                <C.Video autoPlay>
                    <source src="/Video.mp4" type="video/mp4" />
                </C.Video>
            </C.VideoContainer>

            {/* <C.NextModalContainer onClick={() => changeHelpModal()}>
                    <h1>&gt;</h1>
                </C.NextModalContainer> */}
            {/* </C.HelpBox> */}
        </C.HelpContainer>
    )
}

export default Help
